package com.pedidos.reservadegrass;public class Reservasproduct {	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getCancha() {		return cancha;	}	public void setCancha(String cancha) {		this.cancha = cancha;	}	public String getFecha() {		return fecha;	}	public void setFecha(String fecha) {		this.fecha = fecha;	}	public String getFechafin() {		return fechafin;	}	public void setFechafin(String fechafin) {		this.fechafin = fechafin;	}	public String getTipopago() {		return tipopago;	}	public void setTipopago(String tipopago) {		this.tipopago = tipopago;	}	public String getValorcancha() {		return valorcancha;	}	public void setValorcancha(String valorcancha) {		this.valorcancha = valorcancha;	}	private String id,cancha,fecha,fechafin,  tipopago,valorcancha,estado;public Reservasproduct(){}	public Reservasproduct(String id, String cancha, String fecha, String fechafin, String tipopago, String valorcancha, String estado){		this.id = id;		this.cancha = cancha;		this.fecha = fecha;		this.fechafin = fechafin;		this.tipopago = tipopago;		this.valorcancha = valorcancha;		this.estado = estado;	}	public String getEstado() {		return estado;	}	public void setEstado(String estado) {		this.estado = estado;	}}